angular.module('starter.controllers', [])

.controller('AuthCtrl', function($scope, $location, $stateParams, $ionicHistory, $http, $state, $auth, $rootScope, ApiEndpoint) {
        $scope.loginData = {}
        $scope.loginError = false;
        $scope.loginErrorText;
        $scope.login = function() {

        var credentials = {
            email: $scope.loginData.email,
            password: $scope.loginData.password
        }
          $auth.login(credentials)
                .then(function(response) {
                    // Return an $http request for the authenticated user
                    $http.get(ApiEndpoint.url + '/api/v1/authenticate/user').success(function(response){
                     // console.log(response); 
                        // Stringify the retured data
                        var user = JSON.stringify(response.user);
     
                        // Set the stringified user data into local storage
                        localStorage.setItem('user', user);
     
                        // Getting current user data from local storage
                        $rootScope.currentUser = response.user;
                        // $rootScope.currentUser = localStorage.setItem('user');;
                        
                        $ionicHistory.nextViewOptions({
                          disableBack: true
                        });
                        $state.go('tab.home');
                    })
            }).catch(function(response) {
                $scope.loginError = true;
                $scope.loginErrorText = response.data.error;
          })
        }
 
})

.controller('CurrentUserWatchController', function($scope, $rootScope) {
  $rootScope.$watch('currentUser', function(newValue){ //Add a watch to check for changes to the current user
    if (typeof $rootScope.currentUser != "undefined"){
       $scope.userLoggedIn = true; 
       $scope.userLoggedOut = false;  
    } 
    if (typeof $rootScope.currentUser == "undefined" || $rootScope.currentUser == null){
        $scope.userLoggedIn = false; 
        $scope.userLoggedOut = true; 
    }
    }); 
})

